    return (
      <div className="Chart">
        <XYPlot height={400} width={1350}>
          <HorizontalGridLines />
          {funBars}
          {difficultyBars}
          <XAxis />
          <YAxis className="funfactor" />
          <YAxis className="difficulty" />
          <ChartLabel
            text="Assignments"
            className="alt-x-label"
            includeMargin={false}
            xPercent={0.025}
            yPercent={1.01}
          />

          <ChartLabel
            text="Funfactor & difficulty"
            className="alt-y-label"
            includeMargin={false}
            xPercent={0.06}
            yPercent={0.06}
            style={{
              transform: "rotate(-90)",
              textAnchor: "end",
            }}
          />
        </XYPlot>

        <form>
          <label>
            <input
              onChange={this.handleChange}
              id="fun"
              type="checkbox"
              name="data"
              value="funfactor"
            />{" "}
            Funfactor per assignment
          </label>
          <label>
            <input
              onChange={this.handleChange}
              id="difficulty"
              type="checkbox"
              name="data"
              value="difficulty"
            />{" "}
            Difficulty per assignment
          </label>
        </form>
      </div>
    );
  }
}

export default Chart;
